import React from "react";

function Parallax() {
  return (
    <div className="parallax bg-fixed" style={{ backgroundImage: "url('/online-shop.jpg')" }}>
      <h1 className="text-center text-white">Parallax Effect</h1>
      <p className="text-center text-white">Some content here...</p>
    </div>
  );
}

export default Parallax;
